import React, { Component } from 'react'

class LoginPassW extends Component {
    render() {
        const Style = {
            postion: 'relative',
            display: 'flex',
            height : '100px',
            border : '2px solid red',
            justifyContent: 'center',
            alignItems: 'center'            

        }
        return (
            <div style = {Style}>
                PassWorld: 
                <input name="txtSearch" type="text" />
            </div>
        )
    }
}
export default LoginPassW;
